    false,nt"url": null,nt"notes": "During the period from June 26 through
    July 1, 1976, a 6-man crew trapped and banded 2,232 white -fronted geese at two
    locations in Alaska. The operation was a coordinated effort involving personnel
    from the U.S. Fish and Wildlife Service, the Alaska Department of Fish and Game,
    and the Central Flyway represented by the Texas Parks and Wildlife Department. The
    1976 expedition was the second phase of a proposed 5-year project to annually band
    a total of 2,000 white-fronts in Alaska.",nt"license_title": "License Not
